import React, { useState } from "react";
import "./Form.css";
import img from "../Images/contact2.jpg";

const Form = () => {
  const [payload, setPayload] = useState({
    doctor: "",
    patient: "",
    age: "",
    date: "",
    file: "",
  });
  const handleFormChange = (e) => {
    let name = e.target.name;
    let value = e.target.value;
    if(name!="file")
    {
      setPayload({ ...payload, [name]: value });
    }
    
  };
  const handleFormSubmit = async () => {
    const formData = new FormData();
    formData.append('doctor', payload.doctor);
    formData.append('patient', payload.patient);
    formData.append('age', payload.age);
    formData.append('date', payload.date);
    formData.append('file', payload.file);
  
    try {
      const res = await fetch('http://localhost:5000/tracks', {
        method: 'POST',
        body: JSON.stringify(paylo),
      });
      const data = await res.json();
      console.log(data); // log response from server
    } catch (error) {
      console.error('Error:', error);
    }
  };
  
  return (
    <div>
      <div class="modal-box">
        <img class="banner-img-suggest" src={img}></img>

        <form action="http://localhost:5000/tracks" method="POST" encType="multipart/form-data" class="modal-div">
          <p class="suggest-subheader">Sound Data Form</p>

          <div style={{ margin: "6vh 4vh" }}>
            <p class="input-header" id="doctorName">
              Doctor' s Name
            </p>
            <input
              class="input-box"
              style={{ width: "100%", borderRadius: "none" }}
              type="text"
              placeholder="Dr. John"
              name="doctor"
              onChange={handleFormChange}
            ></input>
          </div>
          <div style={{ margin: "6vh 4vh" }}>
            <p class="input-header" id="patientName">
              Patient' s Name
            </p>
            <input
              class="input-box"
              style={{ width: "100%" }}
              type="text"
              placeholder="Priyansh Shrivastav"
              name="patient"
              onChange={handleFormChange}
            ></input>
          </div>
          <div class="input-suggest-flexbox">
            <div style={{ margin: "0vh 4vh" }}>
              <p class="input-header" id="age">
                Patient' s Age
              </p>
              <input
                class="input-box"
                style={{ width: "100%" }}
                type="text"
                placeholder="21"
                name="age"
                onChange={handleFormChange}
              ></input>
            </div>

            <div style={{ margin: "0vh 4vh" }}>
              <p class="input-header" id="date">
                Date
              </p>
              <input
                class="input-box"
                style={{ width: "100%" }}
                type="date"
                placeholder="19-04-2024"
                name="date"
                onChange={handleFormChange}
              ></input>
            </div>
          </div>
          <div style={{ margin: "8vh 4vh" }}>
            <label for="audio" className="input-header">
              Audio File
            </label>
            <input
              type="file"
              id="audio"
              accept=".mp3,audio/*"
              name="file"
              onChange={(e)=>{
                setPayload({...payload,file:e.target.files[0]});
              }}
            />
          </div>

          <button
          type="submit"
            class="suggest-btn"
            id="send_button"
            onClick={handleFormSubmit}
           
          >
            Submit
          </button>
        </form>
      </div>
    </div>
  );
};

export default Form;

